post_caption:
回顧這幾年來，搭乘中華航空出國比賽，每一趟旅程里程數的增加，都是朝著得牌的夢想前進，這次亞運會我帶著團體賽銅牌，以及個人賽銀牌回台，感覺中華航空是一個熟識的朋友，見證我ㄧ路走來的奔波，我覺得很感動♥️ 亞運起程時國家為我們安排了專機，讓我覺得好幸福；回程時也很開心和為我們服務的空服員一起合照，為這些溫暖的安排，獻上感恩～🙏 感謝主，亞運後是一個新的開始，我要針對缺失趕快來改善，不管是在技術、動作控制和心智抗壓能力方面，希望自己像ㄧ個小選手一樣，謙虛踏實的學習，像我當初踏入國家賽事的心情ㄧ樣，保持這顆火熱的心！🔥 #中華挺中華
#中華航空看我成長的朋友
